.include "m2560def.inc"

.include "src/vga.asm"
.include "src/layout.asm"
.include "src/utils.asm"

.dseg

.equ SAMPLE_PERIOD = 512*8   ; 3906 Hz
.equ AUDIO_BUFFER_SIZE = 13

framebuffer: .byte DISPLAY_WIDTH * DISPLAY_HEIGHT
clock: .byte 2
channel1_phase:     .byte 1
channel1_dphase:    .byte 1
channel1_volume:    .byte 1
channel1_wave:      .byte 1 ; [waveform:2][duration:6]
channel2_phase:     .byte 1
channel2_dphase:    .byte 1
channel2_volume:    .byte 1
channel2_wave:      .byte 1 ; [waveform:2][duration:6]
audio_state:        .byte 1 ; can share subroutine_tmp
audio_noise:        .byte 1
audio_buffer:       .byte AUDIO_BUFFER_SIZE

; Registers
; r0                tmp
; r1                zero
; r2-r3             tmp (change?)
; r13-r17, r28-r29  callee-saved (in general)
; r18-r27, r30-r31  caller-saved (in general)
;
; Audio-only registers
; r4-r5     sample pointer
; r6        remaining samples
; r7-r9     tmp
; r10-r12   unused

.cseg
.org 0x0000
    jmp init
.org OC1Aaddr
    jmp isr_loop
.org OC0Aaddr
    movw r8, ZL
    movw ZL, r4
    ld r7, Z+
    out PORTC, r7
    movw r4, ZL
    dec r6
    movw ZL, r8
    reti

init:
    clr r1
    ldi r24, low(framebuffer)
    ldi r25, high(framebuffer)
    out GPIOR0, r24 ; stores the video framebuffer offset (low)
    out GPIOR1, r25 ; stores the video framebuffer offset (high)
    out GPIOR2, r1  ; video frame status

    sts audio_state, r1
    ldi r24, low(audio_buffer)
    ldi r25, high(audio_buffer)
    movw r4, r24
    ldi r25, AUDIO_BUFFER_SIZE
    mov r6, r25

    ldi XL, low(framebuffer)
    ldi XH, high(framebuffer)
    ldi ZL, low(2*test_image)
    ldi ZH, high(2*test_image)
    ldi r24, low(DISPLAY_WIDTH*DISPLAY_HEIGHT)
    ldi r25, high(DISPLAY_WIDTH*DISPLAY_HEIGHT)
_init_screen_iter:
    lpm r0, Z+
    st X+, r0
    sbiw r24, 1
    brne _init_screen_iter
main:
    ldi r18, 0xFF
    ldi r19, 0x00
    out DDRA, r18   ; VGA image output
    out DDRB, r18   ; PB6 is VGA HSYNC
    out DDRE, r18   ; PE4 is VGA VSYNC
    out DDRC, r18
    ; out DDRC, r19   ; controls
    ; out PORTC, r18  ; pull-up

    ; init timers
    ; halt all timers
    ldi r18, (1 << TSM) | (1 << PSRASY) | (1 << PSRSYNC)
    out GTCCR, r18

    ; ctc w/ OCRA, 64 prescaling, interrupt at OCMA
    ldi r25, SAMPLE_PERIOD/64-1
    out OCR0A, r25
    ldi r25, 1 << OCIE0A
    sts TIMSK0, r25
    ldi r24, (1<<WGM01)
    ldi r25, (1<<CS01)|(1<<CS00)
    out TCCR0A, r24
    out TCCR0B, r25

    sts channel1_phase, r1
    ldi r25, 50
    sts channel1_dphase, r25 ; really only usable 8 - 80
    ldi r25, 128
    sts channel1_volume, r25
    ldi r25, 0<<6
    sts channel1_wave, r25

    ldi r25, 1
    sts audio_noise, r25

    ; HSYNC
    ; initialize timer 1 to fast PWM (pin PB6)
    sti TCCR1A, (1 << WGM10) | (1 << WGM11) | (1 << COM1B1) | (1 << COM1B0)
    sti TCCR1B, (1 << WGM12) | (1 << WGM13) | (1 << CS10)
    stiw OCR1AL, (HSYNC_PERIOD - 1)
    stiw OCR1BL, (HSYNC_PERIOD - HSYNC_SYNC_WIDTH - 1)
    sti TIMSK1, (1 << OCIE1A)

    ; VSYNC
    ; initialize timer 3 to fast PWM (pin PE4)
    sti TCCR3A, (1 << WGM30) | (1 << WGM31) | (1 << COM3B1) | (1 << COM3B0)
    sti TCCR3B, (1 << WGM32) | (1 << WGM33) | (1 << CS32)
    stiw OCR3AL, (VSYNC_PERIOD - 1)
    stiw OCR3BL, (VSYNC_PERIOD - VSYNC_SYNC_WIDTH - 1)

    ; synchronize timers
    stiw TCNT1L, (HSYNC_PERIOD - 1)
    stiw TCNT3L, (VSYNC_PERIOD - VSYNC_SYNC_WIDTH - 1)

    ; release timers
    out GTCCR, r1
    sei

    ; enable IDLE sleep mode for reliable interrupt timing
    ldi r18, (1 << SE)
    out SMCR, r18
_main_stall:
    sleep
    rjmp _main_stall

isr_loop:
    ; drop stack frame to save a few bytes
    pop r18
    pop r18
    pop r18

    ; normally, ISRs should be as short as possible and preserve CPU state. Since
    ; everything is done within this ISR, however, that's unnecessary.
    lds r18, TCNT3L
    lds r19, TCNT3H
    cpiw r18, r19, DISPLAY_CLK_TOP, r20
    brpl _loop_active_test2
    rjmp _loop_work
_loop_active_test2:
    cpiw r18, r19, DISPLAY_CLK_BOTTOM, r20
    brlo _loop_active_screen
    rjmp _loop_work
_loop_active_screen:
    ; output a single row from the framebuffer as quickly as reasonably possible.
    in XL, GPIOR0
    in XH, GPIOR1
    in r16, GPIOR2
    andi r16, 0x7f
    write_12_pixels PORTA, X
    write_12_pixels PORTA, X
    write_12_pixels PORTA, X
    write_12_pixels PORTA, X
    write_12_pixels PORTA, X
    write_12_pixels PORTA, X
    write_12_pixels PORTA, X
    write_12_pixels PORTA, X
    write_12_pixels PORTA, X
    write_12_pixels PORTA, X
    nop
    dec r16
    out PORTA, r1
    brpl _loop_generate_audio
    out GPIOR0, XL
    out GPIOR1, XH
    ldi r16, DISPLAY_VERTICAL_STRETCH-1
_loop_generate_audio:
    out GPIOR2, r16
    lds r20, audio_state
    inc r20
    andi r20, 7
    sts audio_state, r20
    breq _loop_generate_audio_reset_buffer
    cpi r20, 2
    brsh _loop_generate_audio_sample
    rjmp _loop_end
_loop_generate_audio_reset_buffer:
    rcall reset_audio_buffer
    rjmp _loop_end
_loop_generate_audio_sample:
    rcall generate_audio_sample
    rjmp _loop_end
_loop_work:
    in r16, GPIOR2
    sbrc r16, 7
    rjmp _loop_reset_render_state
    ori r16, 0x80
    out GPIOR2, r16
    ; force audio to synchronize with frame (TODO: unnecessary?)
    ldi r25, 25+16
    out TCNT0, r25
    sts audio_state, r1
    ; At this point, we've rendered a complete image to the screen, and there's a
    ; fairly long gap (~99,300 cycles) where we fill the framebuffer and update
    ; the game. This corresponds to the VGA vertical front porch and sync pulse,
    ; in addition to the time we save with any blank rows (the latter is the most
    ; significant).
    ; heartbeat, used for syncing with the emulator
    in r0, PORTB
    ldi r16, 0x80
    eor r0, r16
    out PORTB, r0

    lds r24, clock
    lds r25, clock+1
    adiw r24, 1
    sts clock, r24
    sts clock+1, r25

    sts TIMSK1, r1
    sei

    rcall refill_audio_buffer
    rcall long_wait
    rcall refill_audio_buffer
    rcall long_wait
    rcall refill_audio_buffer

_loop_reenter:
    cli

_loop_reset_render_state:
    in r16, GPIOR2
    andi r16, 0x80
    ori r16, DISPLAY_VERTICAL_STRETCH
    out GPIOR2, r16
    ldi r16, low(framebuffer)
    ldi r17, high(framebuffer)
    out GPIOR0, r16
    out GPIOR1, r17
    sbi TIFR1, OCF1A ; clear any pending interrupts
    ldi r16, 1 << OCIE1A
    sts TIMSK1, r16
_loop_end:
    ; exit from interrupt
    sei
    rjmp _main_stall

long_wait: ; 50k cycles or so
    ldi r24, low(11800)
    ldi r25, high(11800)
_lw_loop:
    sbiw r24, 1
    brne _lw_loop
    ret

; Move all samples to the beginning of the audio buffer, so the rest can be
; completely filled. AUDIO_BUFFER_SIZE bytes will copied every time, which will
; probably read past the end of the audio buffer, because performance.
;
; Register Usage
; r25       calculations
; XL, ZL    audio ponters
reset_audio_buffer:
    ldi ZL, low(audio_buffer)
    ldi ZH, high(audio_buffer)
    in r25, SREG
    cli
    movw XL, r4
    movw r4, ZL
.if AUDIO_BUFFER_SIZE != 13
    .error "reset_audio_buffer assumes buffer size of 13, update to match"
.endif
    ld r0, X+
    st Z+, r0
    out SREG, r25
    ld r0, X+
    st Z+, r0
    ld r0, X+
    st Z+, r0
    ld r0, X+
    st Z+, r0
    ld r0, X+
    st Z+, r0
    ld r0, X+
    st Z+, r0
    ld r0, X+
    st Z+, r0
    ld r0, X+
    st Z+, r0
    ld r0, X+
    st Z+, r0
    ld r0, X+
    st Z+, r0
    ld r0, X+
    st Z+, r0
    ld r0, X+
    st Z+, r0
    ld r0, X+
    st Z+, r0
    ret

; Sample and advance both channels, and mix them together. Exits early if at the
; end of the buffer.
;
; Register Usage
;  r20-r27      calculations
;  r25          generated sample
generate_audio_sample:
    ldi r20, low(audio_buffer+AUDIO_BUFFER_SIZE-1)
    ldi r21, high(audio_buffer+AUDIO_BUFFER_SIZE-1)
    movw ZL, r4
    add ZL, r6
    adc ZH, r1
    cp r20, ZL
    cpc r21, ZH
    brsh generate_audio_sample2
    ret
generate_audio_sample2:
    lds r24, audio_noise
_gas_channel_1:
    lds r20, channel1_volume
    lds r21, channel1_phase
    lds r22, channel1_wave
    lds r23, channel1_dphase ; advance channel 1
    add r23, r21
    sts channel1_phase, r23
_gas_channel_1_check_1:
    sbrc r22, 7
    rjmp _gas_channel_1_check_3
_gas_channel_1_check_2:
    sbrc r22, 6
    rjmp _gas_channel_1_noise
_gas_channel_1_sawtooth:
    mul r20, r21
    mov r25, r1
    clr r1
    rjmp _gas_channel_2
_gas_channel_1_noise:
    mov r23, r24
    mov r22, r24
    lsr r22
    eor r23, r22
    lsr r22
    swap r22
    eor r23, r22
    lsr r22
    eor r23, r22
    lsr r23
    rol r24
    mul r20, r24
    mov r25, r1
    clr r1
    rjmp _gas_channel_2
_gas_channel_1_check_3:
    sbrc r22, 6
    rjmp _gas_channel_1_square_75
_gas_channel_1_square_50:
    clr r25
    cpi r21, 64
    brsh _gas_channel_2
    mov r25, r20
    rjmp _gas_channel_2
_gas_channel_1_square_75:
    clr r25
    cpi r21, 192
    brsh _gas_channel_2
    mov r25, r20
_gas_channel_2:
    lds r20, channel2_volume
    lds r21, channel2_phase
    lds r22, channel2_wave
    lds r23, channel2_dphase
    add r23, r21
    sts channel2_phase, r23
_gas_channel_2_check_1:
    sbrc r22, 7
    rjmp _gas_channel_2_check_3
_gas_channel_2_check_2:
    sbrc r22, 6
    rjmp _gas_channel_2_noise
_gas_channel_2_sawtooth:
    mul r20, r21
    mov r26, r1
    clr r1
    rjmp _gas_mix_channels
_gas_channel_2_noise:
    mov r23, r24
    mov r22, r24
    lsr r22
    eor r23, r22
    lsr r22
    swap r22
    eor r23, r22
    lsr r22
    eor r23, r22
    lsr r23
    rol r24
    mul r20, r24
    mov r26, r1
    clr r1
    rjmp _gas_mix_channels
_gas_channel_2_check_3:
    clr r26
    sbrc r22, 6
    rjmp _gas_channel_2_square_75
_gas_channel_2_square_50:
    cpi r21, 64
    brsh _gas_mix_channels
    mov r26, r20
    rjmp _gas_mix_channels
_gas_channel_2_square_75:
    cpi r21, 192
    brsh _gas_mix_channels
    mov r26, r20
_gas_mix_channels:
    add r25, r26
    brcc _gas_write_sample
    ldi r25, 0xff
_gas_write_sample:
    sts audio_noise, r24
    st Z+, r25
    inc r6
    ret

refill_audio_buffer:
    rcall reset_audio_buffer
    ldi ZL, low(audio_buffer)
    ldi ZH, high(audio_buffer)
    mov r20, r6
    add ZL, r20
    adc ZH, r1
    ldi r18, AUDIO_BUFFER_SIZE
    sub r18, r20
_rsb_loop:
    rcall generate_audio_sample
    dec r18
    brne _rsb_loop
    ret

